import { useSnack } from "../../../hooks/useSnack"


export default function IceCreams(){
  const { iceCreams } = useSnack()

  return (
    <>
      <Head title='Sorvetes' />
      <SnackTitle>Sorvetes</SnackTitle>
      <Snacks snacks={iceCreams}></Snacks>
   </>
  )
}
